// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;





/*
ctx imports
*/

const ctxImportObj = {  };




/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "_viewModelId": "AwHeader2",
    "_uniqueViewModelId": "AwHeader2",
    "ctx": {}
};

/*
<header aria-label="{{i18n.applicationHeader}}" class='aw-layout-header clearfix'>
    <div class='sw-column flex-auto'>
        <div class='sw-row flex-auto sw-header-titleContainer'>
            <!-- aw-header-title -->
            {props.children[0]}
            <div class='sw-header-tabsContainer'>
                <!-- aw-tab-container -->
                {props.children[1]}
            </div>
        </div>
        <div class='sw-row flex-auto'>
            <div class='aw-layout-workareaTitle aw-layout-justifyFlexStart'>
                <!-- breadcrumb -->
                {props.children[2]}
            </div>
        </div>
    </div>
    <div class='aw-layout-flexRowContainer align-center'>
        <!-- aw-global-search -->
        {props.children[3]}
        <!-- aw-logo -->
        {props.children[4]}
    </div>
</header>

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <header aria-label={AwParseService.instance( "i18n.applicationHeader" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} className="aw-layout-header clearfix">
        <div className="sw-column flex-auto">
            <div className="sw-row flex-auto sw-header-titleContainer">
                {props.children[0]}
                <div className="sw-header-tabsContainer">
                    {props.children[1]}
                </div>
            </div>
            <div className="sw-row flex-auto">
                <div className="aw-layout-workareaTitle aw-layout-justifyFlexStart">
                    {props.children[2]}
                </div>
            </div>
        </div>
        <div className="aw-layout-flexRowContainer align-center">
            {props.children[3]}
            {props.children[4]}
        </div>
    </header>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
